import React, {Component} from 'react';
import { StyleSheet, Button, View, Text } from 'react-native';

export class CategoriesScreen extends Component {
    render = () => {
        return (
            <View style={{flexDirection:'column', flexWrap:'wrap', alignItems: 'center', justifyContent: 'center', backgroundColor: '#faf9f8', paddingTop: '1%',paddingBottom:'1%'}}>
                <Button title="Карточки" onPress={() => this.props.navigation.navigate('Cards')}/>
                <Text h2 style={{textAlign:'left', paddingTop: 5, paddingBottom:5, marginLeft: '2%', color: '#742774', fontSize: 14}}>Карточки для самого начала</Text>
            <Text h2 style={{textAlign:'left', paddingTop: 5, paddingBottom: 5, marginLeft: '2%', color: '#a4262c', fontSize: 14}}>Общие категории</Text>
            </View>
        );
    }
}
